import React, { Component, useState } from 'react';
import TodoSubList from './todosublist'
import "../App.css"
import Grid from '@material-ui/core/Grid'

const TodoList = (props) => {

    //set up state from app.js

    //Lets return a div with ul with what is inside the state

    let mapper = props.map(input =>
        <div>
            <Grid
                container
                direction="Column"
                justify="center"
                alignItems="center"
            >
                <Grid item>
                    {input.task}
                </Grid>
                <Grid item>
                    {input.dateB}
                </Grid>
                <Grid item>
                    {input.dateE}
                </Grid>
                <Grid item>
                    {input.completed}
                </Grid>
            </Grid>

        </div>
    )
    let content = (
        <div>
            <ul>
                {mapper}
            </ul>
        </div>
    )
    return content
}


export default TodoList;
